deck_description:
The strategy of this deck is to sack your vtuber orphans to get either of your boss monsters while milling your opponent into oblivion.

&nbsp;

That's about it. It's really funny.

&nbsp;

<span>UPDATE 1:</span>

So, since i originally released this deck, i tried to work a bit more of a burn strategy into it as well since Sunny's Snitch is already a burn spell on top of a searcher. Hopefully this should be a more optimal build. Its still obviously non-meta, but its better than what i had before i think.

&nbsp;

Zeus is also in here for buffer room and additional aggro if necessary. Plus, its really funny watching people rage over Zeus when he comes onto board. The side deck is also just full wombo combo shenanigans with Crossout Designator because "y'know."

&nbsp;

ALSO, if you want to prioritize getting Zeus out, run something like Gachi Gachi Gantetsu instead of the single copy of Splash Mage (or you could take out one of the Knightmares instead).

&nbsp;

<span>UPDATE 2:</span>

I've abandoned the burn shenanigans. Its much more consistent now, and incredibly aids as well. lol
